const contacts = [
  { name: "Anju", age: 29, city: "Essen" },
  { name: "Felix", age: 30, city: "Essen" },
];
const ViewContact = () => {
  const [contact, setContact] = useState([
    { name: "Anju", age: 29, city: "Essen" },
    { name: "Felix", age: 30, city: "Essen" },
  ]);
  return (
    <div>
        <table>
            <td>Name</td>
            <td>Age</td>
            <td>City</td>

        </table>
    </div>
  )
};

export default ViewContact;
